// App.jsx
import { Routes, Route } from 'react-router-dom';
import LandingPage from "./Components/Landing/LandingPage.jsx";
import HomePage from './Components/HomePage/HomePage.jsx';
import Detail from './Components/Detail/Detail.jsx';
import { Provider } from 'react-redux'; // Importa Provider de react-redux
import store from './redux/store.js'; // Importa tu store de Redux

function App() {
    return (
        <Provider store={store}> {/* Utiliza Provider y pasa tu store como prop */}
            <div className='App'>
                <Routes >
                    <Route path="/" element={<LandingPage />} />
                    <Route path="/HomePage" element={<HomePage />} />
                    <Route path="/drivers/:idDriver" element={<Detail />} />
                </Routes>
            </div>
        </Provider>
    );
}

export default App;
